import {books} from "./BookData"
const Main = ()=>{
    return(
        <div >
          <article className="book-list">
            {books.map((book)=>{
                return(
                    <li key = {book.id}  >
                        <img src = {book.img} alt = {book.title}/>
                        <h1>{book.title}</h1>
                    </li>
                )
            })}
        </article>
        </div>
    )
}

export default Main;
